import React from 'react';

function ChatPopup({ onClose }) {
  return (
    <div className="chat-popup">
      <div className="chat-message user"><span>Du – 12:43</span><p>Hey Mama, hast du eigentlich dein Rezept für die Spaghetti Bolo irgendwo aufgeschrieben? Ich hab total Lust drauf und will sie mal wieder selbst machen.</p></div>
      <div className="chat-message mama"><span>Mama – 12:45</span><p>Hallo mein Schatz 😊<br />Klar, das hab ich nicht aufgeschrieben, aber ich kann’s dir schnell hier schicken. Willst du die klassische Version oder die, die ich das letzte Mal mit Rotwein gemacht hab?</p></div>
      <div className="chat-message user"><span>Du – 12:46</span><p>Die klassische bitte – so wie früher, mit Karotten und Sellerie und allem.<br />Die hat immer am besten geschmeckt 🥰</p></div>
      <div className="chat-message mama"><span>Mama – 12:47</span><p>Na gut, dann hier:<br />– 500g Rinderhack<br />– 1 Zwiebel<br />– 2 Knoblauchzehen<br />– 1-2 Karotten<br />– 1 Stange Sellerie<br />– 1 EL Tomatenmark<br />– 1 Dose gehackte Tomaten<br />– Salz, Pfeffer, etwas Zucker<br />– Lorbeerblatt<br />– Oregano (frisch oder getrocknet)<br />– Olivenöl zum Anbraten<br />– Optional: ein kleiner Schluck Milch</p></div>
      <div className="chat-message mama"><span>Mama – 12:48</span><p>Zwiebeln, Knoblauch, Karotten und Sellerie klein schneiden und in Olivenöl anbraten. Dann das Hack dazu und krümelig braten. Tomatenmark rein, kurz mitrösten, dann die Tomaten dazu. Würzen und mindestens 30 Minuten köcheln lassen – lieber länger. Zum Schluss evtl. etwas Milch für die Rundung. Fertig 😋</p></div>
      <div className="chat-message user"><span>Du – 12:49</span><p>Perfekt, danke! Milch kommt rein, weil…?</p></div>
      <div className="chat-message mama"><span>Mama – 12:50</span><p>Die macht’s etwas milder und runder im Geschmack. Muss aber nicht – wenn du’s tomatiger magst, lass sie weg.</p></div>
      <div className="chat-message user"><span>Du – 12:51</span><p>Verstanden. Und Nudeln einfach wie immer kochen, oder? 😄</p></div>
      <div className="chat-message mama"><span>Mama – 12:51</span><p>Ja, Spaghetti al dente! Und Parmesan nicht vergessen!</p></div>
      <div className="chat-message user"><span>Du – 12:52</span><p>Mach ich. Danke dir, du Beste ❤️ Ich schick dir ein Foto, wenn’s fertig ist.</p></div>
      <div className="chat-message mama"><span>Mama – 12:53</span><p>Freu mich drauf! Und wenn was fehlt, einfach anrufen. Viel Spaß beim Kochen 😘</p></div>
      <button onClick={onClose} className="close-chat">Schließen</button>
    </div>
  );
}

export default ChatPopup;
